function makeCircle(posX, posY, radius, fillColor) {
    var circle = "<circle cx='";
    circle += posX;
    circle += "' cy='";
    circle += posY;
    circle += "' r='"
    circle += radius;
    circle += "' stroke='none' fill='";
    circle += fillColor;
    circle += "' />"

    return circle;
}

function makeText(posX, posY, fillColor, content, fontSize, fontFamily, fontWeight) {
    if (fontSize === undefined) {
        fontSize = 35;
    }

    if (fontFamily === undefined) {
        fontFamily = "Arial Black";
    }

    if (fontWeight === undefined) {
        fontWeight = "bold";
    }

    var text = '<text x="';
    text += posX;
    text += '" y="';
    text += posY;
    text += '" fill="';
    text += fillColor;
    text += '" font-size="';
    text += fontSize;
    text += 'px" font-weight="';
    text += fontWeight;
    text += '" font-family="';
    text += fontFamily;
    text += '" >';
    text += content;
    text += '</text>';

    return text;
}

